import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./index.css";
import rockies from "./Rockies.png";

function NlWest(props) {
  return (
    <a href={props.teamId}>
      <img src={props.img} className="NlWest" />
    </a>
  );
}

export default NlWest;
